settings.custom_css:
.botao .elementor-button {
    box-shadow: 0px 9px 30px 0px rgba(255, 255, 255, 0.28);
    position: relative;
    z-index: 1;
    background-color: #F29207; /* Cor principal */
    color: #FFFFFF; /* Cor do texto em branco */
    border: 4px solid #808080; /* Borda de 4px */
}

.botao::before {
    content: "";
    position: absolute;
    top: 50%;
    left: 50%;
    width: calc(100% + 10px);
    height: calc(100% + 10px);
    border: 0px solid #808080;
    transform: translate(-50%, -50%);
    border-radius: 5px;
    transition: 0.3s;
    pointer-events: none;
    z-index: 0;
}

.botao:hover::before {
    width: 100%;
    height: 100%;
}

.botao:hover .elementor-button {
    transition: 1s 0.3s;
    box-shadow: 0px 0px 300px 10px #ffffff70;
}

.botao .elementor-button-icon,
.botao .elementor-button-icon svg {
    transition: 0.5s !important;
}

.botao:hover .elementor-button-icon {
    transform-origin: center;
    transform: rotate(45deg);
}

.botao:hover .elementor-button-icon svg {
    transform-origin: center;
    animation: seta 1s infinite;
}

.botao .elementor-button-content-wrapper {
    display: flex;
    align-items: center;
}

@keyframes seta {
    0%, 100% {
        transform: translate(0px, 0px);
    }
    50% {
        transform: translate(10px, -10px);
    }
}

selector .elementor-button {
    animation: 2s cubic-bezier(0.2, 0.5, 0.9, 0.6) 2s infinite brilho;
    background-image: linear-gradient(45deg, #F29207, #FFFFFF, #F29207, #FFFFFF); /* Gradiente com as cores desejadas */
    background-size: 400% 200%;
    transition: all .8s;
}

@keyframes brilho {
    0% {
        background-position: 0 0;
    }
    100% {
        background-position: 100% 0;
    }
}

selector .elementor-button svg {
    width: 20px; /*altere o tamanho aqui*/
    height: 20px; /*altere o tamanho aqui*/
    vertical-align: middle;
}

